            </div>
            <div className='services__service'>
                <img src="https://img.freepik.com/premium-photo/3d-illustration-doctor-physician-3d-illustration-3d-rendering-doctor-illustration-showing-prescription-paper_516484-41.jpg?w=2000" alt="medicare" />
                <span className='title'>Medicare</span>
                <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Ratione tempore suscipit maxime voluptatibus velit modi, distinctio quos earum. Culpa, vitae!</p>
                <button type="submit arrow-right">Learn More</button>
            </div>
        </div>
        </>
    );
}
